import React from 'react'
import { Link } from 'react-router-dom'
import { Navbar } from 'flowbite-react' 

function Header() {
  return (
    <Navbar className='border-b-2'>
      <Link to="/">
        <span><Student></Student></span>
      </Link>
    </Navbar>
  )
}

export default Header
